import React from "react";
import { Outlet } from "react-router-dom";
import EventNavigation from "./EventNavigation";

const EventRootLayout = () => {
  return (
    <>
      <EventNavigation />
      <main>
        <Outlet />
      </main>
    </>
  );
};

export default EventRootLayout;
